import React from "react";
import Header from "../components/Header";
import Footer from "../components/Footer";
import "./Home.css";

const Home = () => {
  return (
    <div className="home">
      <Header />
      <main className="intro">
        <h1>Welcome to CounselPro</h1>
        <p>Your trusted platform for mental health support and guidance.</p>
      </main>
      <Footer />
    </div>
  );
};

export default Home;
